import React from 'react';
import './Recognition.css';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import PhotoCamera from '@mui/icons-material/PhotoCamera';
import Stack from '@mui/material/Stack';

function FaceMaster(){
    return(
        <div>
            <DashAccess/>
            <UploadButtons/>
        </div>
    )
}
const Input = styled('input')({
    display: 'none',
  });
  
  function UploadButtons() {
    return (
      <Stack direction="row" alignItems="center"   justifyContent="center" spacing={2}>
        <label htmlFor="contained-button-file">
          <Input accept="image/*" id="contained-button-file" multiple type="file" />
          <Button variant="contained" component="span">
            Upload
          </Button>
        </label>
        <label htmlFor="icon-button-file">
          <Input accept="image/*" id="icon-button-file" type="file" />
          <IconButton color="primary" aria-label="upload picture" component="span">
            <PhotoCamera />
          </IconButton>
        </label>
      </Stack>
    );
  }

function DashAccess(){
    return(
        <div>
            <p style={{textAlign: 'center'}}>Hello</p>
            <form style={{textAlign: 'center'}}>
            <label for="file-upload" class="custom-file-upload" style={{textAlign: 'center'}}>
            <i class="fa fa-cloud-upload"> Upload Image</i>
                </label>
                <input id="file-upload" name='upload_cont_img' type="file" style={{display: 'none'}}></input>
            </form>
        </div>
    )
}
export default FaceMaster;
